query:
SELECT ?property ?hasValue ?isValueOf
WHERE {
  { <http://dbpedia.org/resource/Motörhead> ?property ?hasValue }
  UNION
  { ?isValueOf ?property <http://dbpedia.org/resource/Motörhead> }
}

SELECT ?property ?hasValue ?isValueOf
WHERE {
  { <http://upload.wikimedia.org/wikipedia/commons/thumb/f/fa/Cometary_Orbital_Drive.jpg/200px-Cometary_Orbital_Drive.jpg> ?property ?hasValue }
  UNION
  { ?isValueOf ?property <http://upload.wikimedia.org/wikipedia/commons/thumb/f/fa/Cometary_Orbital_Drive.jpg/200px-Cometary_Orbital_Drive.jpg> }
}

select ?abstract ?thumbnail where { 
  dbpedia:Ernest_Hemingway dbpedia-owl:abstract ?abstract ;
                           dbpedia-owl:thumbnail ?thumbnail .
  filter(langMatches(lang(?abstract),"en"))
}

